function fillTable(searchResult) {
		for(var i=0; i<searchResult.trips.tripOption.length; i++){
			var price = searchResult.trips.tripOption[i]["saleTotal"].replace("USD", "USD $")
			
			var airline;
			var airlineCode = searchResult.trips.tripOption[i].slice[0].segment[0].flight["carrier"];
			for(var c=0; c<searchResult.trips.data.carrier.length; c++){
				if(searchResult.trips.data.carrier[c]["code"]===airlineCode) { airline=searchResult.trips.data.carrier[c]["name"] }
			}
			
			var departureTime = (new Date(searchResult.trips.tripOption[i].slice[0].segment[0].leg[0]["departureTime"])).toLocaleTimeString()
			var totalSegs = searchResult.trips.tripOption[i].slice[0].segment.length
			var arrivalTime = (new Date(searchResult.trips.tripOption[i].slice[0].segment[totalSegs-1].leg[0]["departureTime"])).toLocaleTimeString()
			
			var duration = searchResult.trips.tripOption[i].slice[0]["duration"]
			var durationHours = Math.floor(duration/60)
			var durationMinutes = duration%60
			
			$( "#searchResultsBody" ).append('<tr><th scope="row">'+(i+1)+'</th><td>'+price+'</td><td>'+airline+'</td><td>'+ departureTime + 
			'</td><td>'+ arrivalTime +'</td><td>' + durationHours + 'h' + durationMinutes + 'm' + '</td><td>'+ (totalSegs-1)+'</td></tr>');
		}
	}
